window.__nefbl_pack__bundleSrc__[55]=function(){var n={};return n.default='<!DOCTYPE html>\r\n<html lang="zh-cn">\r\n\r\n<head>\r\n    <meta charset="UTF-8">\r\n    <meta http-equiv="X-UA-Compatible" content="IE=edge">\r\n    <meta name="viewport" content="width=device-width, initial-scale=1.0">\r\n    <title>CSS 属性&值 / Transform</title>\r\n    <style>\r\n        .box {\r\n            width: 300px;\r\n            height: 100px;\r\n        }\r\n\r\n        .outer {\r\n            background-color: #e8e7a4;\r\n            margin: 30px;\r\n            text-align: center;\r\n        }\r\n\r\n        .inner {\r\n            background-color: #4dcfd2;\r\n            width: 50px;\r\n            height: 50px;\r\n            display: inline-block;\r\n        }\r\n\r\n        /* 第一个 */\r\n        .demo1 {\r\n            perspective: 200px;\r\n        }\r\n\r\n        .demo1 .inner {\r\n            transform: rotateY(45deg);\r\n        }\r\n\r\n        /* 第二个 */\r\n        .demo2 .inner {\r\n            transform: perspective(200px) rotateY(45deg);\r\n        }\r\n    </style>\r\n</head>\r\n\r\n<body>\r\n    <div class="outer box demo1">\r\n        <div class="inner box"></div>\r\n        <div class="inner box"></div>\r\n        <div class="inner box"></div>\r\n    </div>\r\n\r\n    <div class="outer box demo2">\r\n        <div class="inner box"></div>\r\n        <div class="inner box"></div>\r\n        <div class="inner box"></div>\r\n    </div>\r\n</body>\r\n\r\n</html>',n};